import { Box, Card, CardContent, CircularProgress, Typography } from '@material-ui/core'
import React from 'react'

export default function UsersComponent(props) {
    const { gitUsers, loading, error } = props;

    console.log(gitUsers)
    return (
        <Box style={{display: 'flex', justifyContent: 'center', marginTop: '2rem'}}>
            <Card style={{width: '50%'}}>
                <CardContent>
                    {loading && (<CircularProgress />)}
                    {
                     gitUsers.length > 0 ? (
                        <Box>
                        <Typography 
                            variant="h5" component="h5" 
                            style={{textAlign: 'center', fontWeight: 'bold'}}>
                            Git User Info Search Result
                        </Typography>
                    </Box>
                     ) :
                      
                     <Alert></Alert>
                    
                    }
                </CardContent>
            </Card>
        </Box>
    )
}
